export type StackIconNames =
  | 'react'
  | 'nodejs'
  | 'nextjs'
  | 'vercel'
  | 'redux'
  | 'aws'
  | 'tailwind'
  | 'postgres'
  | 'circleci'
  | 'mongodb'
  | 'apollo'
  | 'azure'
  | 'jenkins'
  | 'docker'
  | 'typescript';

export type CompanyIconNames = 'corellium' | 'pay' | 'leadchat' | 'backifi';

export type SocialIconsNames = 'github' | 'linkedin';

export type EducationIconNames = 'ga' | 'usyd' | 'aftrs' | 'sfs';

export type UtilityIconsNames =
  | 'location'
  | 'sun'
  | 'arrowRight'
  | 'arrowLeftCircle'
  | 'arrowTopRight'
  | 'moon';

export type IconNames =
  | StackIconNames
  | CompanyIconNames
  | UtilityIconsNames
  | EducationIconNames
  | SocialIconsNames;

type IconsProps = {
  name: IconNames;
  size?: number;
  className?: string;
  fill?: string;
  onClick?: () => void;
  theme?: string;
};

type IconsMap = {
  [key in IconNames]: FC<IndividualIconProps>;
};

const iconsMap: IconsMap = {
  github: Github,
  linkedin: LinkedIn,
  location: Location,
  sun: Sun,
  moon: Moon,
  arrowRight: ArrowRight,
  arrowLeftCircle: ArrowLeftCircle,
  arrowTopRight: ArrowTopRight,
  corellium: Corellium,
  pay: Pay,
  leadchat: Leadchat,
  backifi: Backifi,
  ga: GA,
  sfs: SFS,
  aftrs: AFTRS,
  usyd: USYD,
  react: React,
  nodejs: NodeJS,
  nextjs: NextJS,
  vercel: Vercel,
  redux: Redux,
  aws: AWS,
  tailwind: Tailwind,
  postgres: Postgres,
  circleci: CircleCI,
  mongodb: MongoDB,
  apollo: Apollo,
  azure: Azure,
  jenkins: Jenkins,
  docker: Docker,
  typescript: TypeScript,
};

export const Icons: FC<IconsProps> = ({
  name,
  size = '24',
  className,
  fill = neutral[900],
  theme = 'dark',
}) => {
  const Icon = iconsMap[name];

  return (
    <Icon
      size={size?.toString()}
      className={className}
      theme={theme}
      fill={fill}
    />
  );
};
